import React from 'react'

const FilterBox = ({gameVer}) => {
    return(
        <div className='dropdown'>
            <div className='control'>
                <div className='selected-value'>Select Game...</div>
                <div className='arrow'/>
            </div>      
            <div className='options'>
                {gameVer.map((vers) => (
                        <div className='option'>{vers.name}</div>)
                    )}
            </div>    
        </div>
    )
}

export default FilterBox;
